import React from 'react';

const HomeListingCard = ({
  imageURL,
  homeName,
  startingPrice,
  beds,
  baths,
  sqft,
  isMultiSection
}) => {
  const
  nuberWithCommas = (x) => {
    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
  }
    price = numberWithCommas(startingPrice),
    size = nuberWithCommas(sqft)
  //if (!homeName) return (null);
  return (
    <React.Fragment>
      <figure>
        <img src={imageURL} />
      </figure>
      <div>
        <h5>{homeName}</h5>
        <p>{beds} beds • {baths} baths • {size} sq. ft.</p>
      </div>
      <div>
        <p>Starting Price</p>
        <p>${price}</p>
      </div>
    </React.Fragment>
  )
};

export default HomeListingCard;
